import { useState } from "react";
import "./moving.css";
import { Input } from "antd";

const MovingType = () => {
  const [lock1, setLock1] = useState(false);
  const [lock2, setLock2] = useState(false);
  const [lock3, setLock3] = useState(false);
  const [lock4, setLock4] = useState(false);
  const [lock5, setLock5] = useState(false);
  const [lock6, setLock6] = useState(false);
  const [lock7, setLock7] = useState(false);

  const renderInputBlock = (label, placeholder, state, setState) => (
    <div className="text-start flex flex-col items-center pt-4">
      <p className="w-1/2 ">{label}</p>
      <Input
        className="w-2/4"
        placeholder={placeholder}
        onClick={() => setState(true)}
      />
    </div>
  );

  return (
    <div className="bg-[#8AFFC133] mx-auto w-11/12 h-auto items-center justify-center text-center p-4 lg:w-4/5 rounded-lg border-neutral-600 m-12 border">
      <div>
        <h2 className="text-[#13C265] text-2xl font-semibold mb-4">Moving Type</h2>
      </div>
      <div className="flex items-center justify-between">
        <button className="w-40 bg-[#D1D1D1] flex-wrap m-2 p-1 rounded shadow text-md sm:text-base lg:text-lg active:text-red-blue">Local</button>
        <button className="w-40 bg-[#D1D1D1] flex-wrap m-2 p-1 rounded shadow text-md sm:text-base lg:text-lg">Commercial</button>
        <button className="w-40 bg-[#D1D1D1] flex-wrap m-2 p-1 rounded shadow text-md sm:text-base lg:text-lg">International</button>
      </div>
      <div>
        {renderInputBlock("Move from", "Address", lock1, setLock1)}
        {lock1 && renderInputBlock("Move to", "Address", lock2, setLock2)}
        {lock2 && renderInputBlock("Bedrooms", "Address", lock3, setLock3)}
        {lock3 && renderInputBlock("Specific date", "Address", lock4, setLock4)}
        {lock4 && renderInputBlock("Date Range", "Address", lock5, setLock5)}
        {lock5 && renderInputBlock("Personal details", "Name", lock6, setLock6)}
        {lock6 && renderInputBlock("Contact details", "Email", lock7, setLock7)}
        {lock7 && renderInputBlock("Contact details", "Phone number", lock7, setLock7)}

        <button className="w-80 bg-[#00DD68] p-2 rounded-lg text-white mt-4">Request quotes</button>
      </div>
    </div>
  );
};

export default MovingType;
